    <path
      fillRule="evenodd"
      clipRule="evenodd"
      d="M2.293 8.293A1 1 0 0 1 3 8h7V2H2v6.586l.293-.293ZM1 11V2a1 1 0 0 1 1-1h8a1 1 0 0 1 1 1v6a1 1 0 0 1-1 1H3l-2 2Z"
